static real32_T look1_iflf_binlx(real32_T GTu0, const real32_T GTbp0[], const
  real32_T GTtable[], uint32_T GTmaxIndex)
{
  real32_T GTfrac;
  real32_T GTyL_0d0;
  uint32_T GTiLeft;
  if (GTu0 <= GTbp0[0U]) {
    GTiLeft = 0U;
    GTfrac = (GTu0 - GTbp0[0U]) / (GTbp0[1U] - GTbp0[0U]);
  } else if (GTu0 < GTbp0[GTmaxIndex]) {
    uint32_T GTbpIdx;
    uint32_T GTiRght;
    GTbpIdx = GTmaxIndex >> 1U;
    GTiLeft = 0U;
    GTiRght = GTmaxIndex;
    while (GTiRght - GTiLeft > 1U) {
      if (GTu0 < GTbp0[GTbpIdx]) {
        GTiRght = GTbpIdx;
      } else {
        GTiLeft = GTbpIdx;
      }

      GTbpIdx = (GTiRght + GTiLeft) >> 1U;
    }

    GTfrac = (GTu0 - GTbp0[GTiLeft]) / (GTbp0[GTiLeft + 1U] - GTbp0[GTiLeft]);
  } else {
    GTiLeft = GTmaxIndex - 1U;
    GTfrac = (GTu0 - GTbp0[GTmaxIndex - 1U]) / (GTbp0[GTmaxIndex] -
      GTbp0[GTmaxIndex - 1U]);
  }

  GTyL_0d0 = GTtable[GTiLeft];
  return (GTtable[GTiLeft + 1U] - GTyL_0d0) * GTfrac + GTyL_0d0;
}

static uint32_T binsearch_u32f(real32_T GTu, const real32_T GTbp[], uint32_T
  GTstartIndex, uint32_T GTmaxIndex)
{
  uint32_T GTbpIdx;
  uint32_T GTbpIndex;
  uint32_T GTiRght;
  GTbpIdx = GTstartIndex;
  GTbpIndex = 0U;
  GTiRght = GTmaxIndex;
  while (GTiRght - GTbpIndex > 1U) {
    if (GTu < GTbp[GTbpIdx]) {
      GTiRght = GTbpIdx;
    } else {
      GTbpIndex = GTbpIdx;
    }

    GTbpIdx = (GTiRght + GTbpIndex) >> 1U;
  }

  return GTbpIndex;
}

static uint8_T look1_iu8lu32n24_binlcse(uint8_T GTu0, const uint8_T GTbp0[],
  const uint8_T GTtable[], uint32_T GTmaxIndex)
{
  uint32_T GTfrac;
  uint32_T GTiLeft;
  uint8_T GTbpLeftVar;
  uint8_T GTy;
  uint8_T GTyL_0d0;
  if (GTu0 <= GTbp0[0U]) {
    GTiLeft = 0U;
    GTfrac = 0U;
  } else if (GTu0 < GTbp0[GTmaxIndex]) {
    uint32_T GTiRght;
    GTfrac = GTmaxIndex >> 1U;
    GTiLeft = 0U;
    GTiRght = GTmaxIndex;
    while (GTiRght - GTiLeft > 1U) {
      if (GTu0 < GTbp0[GTfrac]) {
        GTiRght = GTfrac;
      } else {
        GTiLeft = GTfrac;
      }

      GTfrac = (GTiRght + GTiLeft) >> 1U;
    }

    GTbpLeftVar = GTbp0[GTiLeft];
    GTfrac = ((uint32_T)(uint8_T)((uint32_T)GTu0 - GTbpLeftVar) << 24) /
      (uint8_T)((uint32_T)GTbp0[GTiLeft + 1U] - GTbpLeftVar);
  } else {
    GTiLeft = GTmaxIndex - 1U;
    GTfrac = 16777216U;
  }

  GTbpLeftVar = GTtable[GTiLeft + 1U];
  GTyL_0d0 = GTtable[GTiLeft];
  if (GTbpLeftVar >= GTyL_0d0) {
    GTy = (uint8_T)((uint32_T)(uint8_T)(((uint8_T)((uint32_T)GTbpLeftVar -
      GTyL_0d0) * GTfrac) >> 24) + GTyL_0d0);
  } else {
    GTy = (uint8_T)((uint32_T)GTyL_0d0 - (uint8_T)(((uint8_T)((uint32_T)GTyL_0d0
      - GTbpLeftVar) * GTfrac) >> 24));
  }

  return GTy;
}

static uint32_T plook_u32f_binckan(real32_T GTu, const real32_T GTbp[], uint32_T
  GTmaxIndex)
{
  uint32_T GTbpIndex;
  if (GTu <= GTbp[0U]) {
    GTbpIndex = 0U;
  } else if (GTu < GTbp[GTmaxIndex]) {
    GTbpIndex = binsearch_u32f(GTu, GTbp, GTmaxIndex >> 1U, GTmaxIndex);
    if ((GTbpIndex < GTmaxIndex) && (GTbp[GTbpIndex + 1U] - GTu <= GTu -
         GTbp[GTbpIndex])) {
      GTbpIndex++;
    }
  } else {
    GTbpIndex = GTmaxIndex;
  }

  return GTbpIndex;
}

