static void ADAS_Obj13inmarklinecoordsys(boolean_T GTu_Enable, const real_T
  GTu_Y_MarkLineRearSameSide[12], const real_T GTu_point_old_coord[3], real32_T
  GTy_y_target_MarkLineCoordSys[3], real_T *GTy_sum_segments_length, real_T
  *GTy_hasPointProjOnMarkLineFlag, DW_Obj13inmarklinecoordsys_AD_T *localDW)
{
  real_T GTA[9];
  real_T GTA_1[9];
  real_T rtb_GT_CastToBoolean5[7];
  real_T GTA_0[3];
  real_T rtb_GT_point_new_coord[3];
  int32_T GTi;
  int32_T GTi_0;
  if (GTu_Enable) {
    real_T GTsum_segments_length;
    int32_T GThasPointProjOnMarkLineFlag;
    boolean_T exitg1;
    localDW->GTObj13inmarklinecoordsys_MODE = true;
    for (GTi = 0; GTi < 7; GTi++) {
      rtb_GT_CastToBoolean5[GTi] = X_MarkLineRear[GTi];
    }

    rtb_GT_point_new_coord[0] = 0.0;
    rtb_GT_point_new_coord[1] = 0.0;
    rtb_GT_point_new_coord[2] = 0.0;
    GTsum_segments_length = 0.0;
    GThasPointProjOnMarkLineFlag = 0;
    GTi = 1;
    exitg1 = false;
    while ((!exitg1) && (GTi - 1 < 6)) {
      real_T GTl;
      real_T GTl_tmp;
      real_T GTl_tmp_0;
      real_T GTsegment_length;
      real_T GTsegment_length_tmp;
      GTl_tmp = rtb_GT_CastToBoolean5[GTi - 1] - rtb_GT_CastToBoolean5[GTi];
      GTl_tmp_0 = GTu_Y_MarkLineRearSameSide[GTi - 1] -
        GTu_Y_MarkLineRearSameSide[GTi];
      GTsegment_length_tmp = GTl_tmp * GTl_tmp;
      GTsegment_length = sqrt(GTl_tmp_0 * GTl_tmp_0 + GTsegment_length_tmp);
      GTsum_segments_length += GTsegment_length;
      GTl = sqrt(GTl_tmp_0 * GTl_tmp_0 + GTsegment_length_tmp);
      GTA[0] = GTl_tmp / GTl;
      GTA[3] = GTl_tmp_0 / GTl;
      GTA[6] = 0.0 / GTl;
      GTl = sqrt((0.0 - GTl_tmp_0) * (0.0 - GTl_tmp_0) + GTsegment_length_tmp);
      GTA[1] = (0.0 - GTl_tmp_0) / GTl;
      GTA[4] = GTl_tmp / GTl;
      GTA[7] = 0.0 / GTl;
      GTA[2] = 0.0;
      GTA[5] = 0.0;
      GTA[8] = 1.0;
      for (GTi_0 = 0; GTi_0 < 3; GTi_0++) {
        GTA_0[GTi_0] = (GTA[GTi_0 + 3] * GTu_point_old_coord[1] + GTA[GTi_0] *
                        GTu_point_old_coord[0]) + GTA[GTi_0 + 6] *
          GTu_point_old_coord[2];
      }

      for (GTi_0 = 0; GTi_0 < 9; GTi_0++) {
        GTA_1[GTi_0] = -GTA[GTi_0];
      }

      GTl_tmp = rtb_GT_CastToBoolean5[GTi];
      GTl_tmp_0 = GTu_Y_MarkLineRearSameSide[GTi];
      for (GTi_0 = 0; GTi_0 < 3; GTi_0++) {
        rtb_GT_point_new_coord[GTi_0] = (GTA_1[GTi_0 + 3] * GTl_tmp_0 +
          GTA_1[GTi_0] * GTl_tmp) + GTA_0[GTi_0];
      }

      if ((rtb_GT_point_new_coord[0] >= 0.0) && (rtb_GT_point_new_coord[0] <=
           GTsegment_length)) {
        GThasPointProjOnMarkLineFlag = 1;
        exitg1 = true;
      } else {
        GTi++;
      }
    }

    if (GThasPointProjOnMarkLineFlag == 1) {
      *GTy_sum_segments_length = GTsum_segments_length - rtb_GT_point_new_coord
        [0];
    } else {
      *GTy_sum_segments_length = 999999.0;
      rtb_GT_point_new_coord[0] = 0.0;
      rtb_GT_point_new_coord[1] = 0.0;
      rtb_GT_point_new_coord[2] = 0.0;
    }

    *GTy_hasPointProjOnMarkLineFlag = GThasPointProjOnMarkLineFlag;
    GTy_y_target_MarkLineCoordSys[0] = (real32_T)rtb_GT_point_new_coord[0];
    GTy_y_target_MarkLineCoordSys[1] = (real32_T)rtb_GT_point_new_coord[1];
    GTy_y_target_MarkLineCoordSys[2] = (real32_T)rtb_GT_point_new_coord[2];
  } else if (localDW->GTObj13inmarklinecoordsys_MODE) {
    Obj13inmarklinecoordsys_Disable(GTy_y_target_MarkLineCoordSys,
      GTy_sum_segments_length, GTy_hasPointProjOnMarkLineFlag, localDW);
  }
}

static void ADAS_HysteresisMATLABfunction(real32_T GTu_x, real32_T GTu_x_prev,
  real_T GTu_x_to_low, real_T GTu_x_to_high, real_T GTu_y_prev, real_T *GTy_y)
{
  if (GTu_x_to_high > GTu_x_to_low) {
    if (GTu_x <= GTu_x_to_low) {
      *GTy_y = 0.0;
    } else if (GTu_x >= GTu_x_to_high) {
      *GTy_y = 1.0;
    } else {
      *GTy_y = GTu_y_prev;
    }
  } else if (GTu_x < GTu_x_to_high) {
    *GTy_y = 0.0;
  } else if (GTu_x > GTu_x_to_low) {
    *GTy_y = 1.0;
  } else if (GTu_x_prev < GTu_x_to_high) {
    *GTy_y = 1.0;
  } else if (GTu_x_prev > GTu_x_to_low) {
    *GTy_y = 0.0;
  } else {
    *GTy_y = GTu_y_prev;
  }
}

