    rtb_GT_CastToBoolean18[0] = GTu_Obj13SxOppositeSidePoint;
    rtb_GT_CastToBoolean18[1] = GTu_Obj13SyOppositeSidePoint;
    rtb_GT_CastToBoolean18[2] = localC->GTCastToBoolean2;
