static void Dow_warning_requester_SF_chart(boolean_T GTu_CVW, boolean_T
  GTu_isDoorAjar, real32_T GTu_MinWarnTime, real32_T GTu_DelayTimeOnFallEdge,
  real32_T GTu_BlockWarnTime, real32_T GTu_DelayTimeOnRisingEdge, uint8_T
  *GTy_DtLogDowWarnReqTrans, uint8_T *GTy_DowLedReq, uint8_T *GTy_DowWarnReq,
  DW_Dow_warning_requester_SF_c_T *localDW)
{
  if (localDW->GTtemporalCounter_i1 < MAX_uint32_T) {
    localDW->GTtemporalCounter_i1++;
  }

  if (localDW->GTis_active_c632_ADAS == 0U) {
    localDW->GTis_active_c632_ADAS = 1U;
    localDW->GTdurationCounter_1 = 0;
    localDW->GTis_c632_ADAS = ADAS_IN_Expectation;
    localDW->GTtemporalCounter_i1 = 0U;
    *GTy_DowLedReq = 0U;
    *GTy_DowWarnReq = 0U;
  } else if (localDW->GTis_c632_ADAS == ADAS_IN_Expectation) {
    if (GTu_CVW && (localDW->GTtemporalCounter_i1 >= GTu_BlockWarnTime * 20.0F) &&
        ((real_T)localDW->GTdurationCounter_1 >= GTu_DelayTimeOnRisingEdge *
         20.0F)) {
      *GTy_DtLogDowWarnReqTrans = 1U;
      localDW->GTdurationCounter_1_f = 0;
      localDW->GTis_c632_ADAS = ADAS_IN_Warning_state;
      localDW->GTtemporalCounter_i1 = 0U;
      localDW->GTis_Warning_state = ADAS_IN_Warning_level1;
      *GTy_DowLedReq = 1U;
      *GTy_DowWarnReq = 0U;
    } else {
      *GTy_DowLedReq = 0U;
      *GTy_DowWarnReq = 0U;
    }
  } else if ((!GTu_CVW) && (localDW->GTtemporalCounter_i1 >= GTu_MinWarnTime *
              20.0F) && ((real_T)localDW->GTdurationCounter_1_f >=
                         GTu_DelayTimeOnFallEdge * 20.0F)) {
    *GTy_DtLogDowWarnReqTrans = 2U;
    localDW->GTis_Warning_state = ADAS_IN_NO_ACTIVE_CHILD_j;
    localDW->GTdurationCounter_1 = 0;
    localDW->GTis_c632_ADAS = ADAS_IN_Expectation;
    localDW->GTtemporalCounter_i1 = 0U;
    *GTy_DowLedReq = 0U;
    *GTy_DowWarnReq = 0U;
  } else if (localDW->GTis_Warning_state == ADAS_IN_Warning_level1) {
    if (GTu_isDoorAjar) {
      *GTy_DtLogDowWarnReqTrans = 3U;
      localDW->GTis_Warning_state = ADAS_IN_Warning_level2;
      *GTy_DowLedReq = 2U;
      *GTy_DowWarnReq = 1U;
    } else {
      *GTy_DowLedReq = 1U;
      *GTy_DowWarnReq = 0U;
    }
  } else if (!GTu_isDoorAjar) {
    *GTy_DtLogDowWarnReqTrans = 4U;
    localDW->GTis_Warning_state = ADAS_IN_Warning_level1;
    *GTy_DowLedReq = 1U;
    *GTy_DowWarnReq = 0U;
  } else {
    *GTy_DowLedReq = 2U;
    *GTy_DowWarnReq = 1U;
  }

  if (GTu_CVW) {
    localDW->GTdurationCounter_1++;
    localDW->GTdurationCounter_1_f = 0;
  } else {
    localDW->GTdurationCounter_1 = 0;
    localDW->GTdurationCounter_1_f++;
  }
}

