static void ADAS_LEDblinkingclockingblock(real32_T GTu_BlinkPeriod, uint8_T
  GTu_InLedReq, uint8_T *GTy_OutLedReq, DW_LEDblinkingclockingblock_A_T *localDW)
{
  if (localDW->GTtemporalCounter_i1 < MAX_uint32_T) {
    localDW->GTtemporalCounter_i1++;
  }

  if (localDW->GTis_active_c635_ADAS == 0U) {
    localDW->GTis_active_c635_ADAS = 1U;
    localDW->GTis_c635_ADAS = ADAS_IN_Light_off;
    localDW->GTtemporalCounter_i1 = 0U;
    *GTy_OutLedReq = 0U;
  } else if (localDW->GTis_c635_ADAS == ADAS_IN_Light_off) {
    if ((GTu_InLedReq == 1) || ((GTu_InLedReq == 2) &&
         (localDW->GTtemporalCounter_i1 >= GTu_BlinkPeriod / 2.0F * 20.0F))) {
      localDW->GTis_c635_ADAS = ADAS_IN_Light_on;
      localDW->GTtemporalCounter_i1 = 0U;
      *GTy_OutLedReq = 1U;
    } else {
      *GTy_OutLedReq = 0U;
    }
  } else if ((GTu_InLedReq == 0) || ((GTu_InLedReq == 2) &&
              (localDW->GTtemporalCounter_i1 >= GTu_BlinkPeriod / 2.0F * 20.0F)))
  {
    localDW->GTis_c635_ADAS = ADAS_IN_Light_off;
    localDW->GTtemporalCounter_i1 = 0U;
    *GTy_OutLedReq = 0U;
  } else {
    *GTy_OutLedReq = 1U;
  }
}

