static boolean_T ADAS_isPointInPolygon(const captured_var_ADAS_T
  *GTPoly_YawRateRadSLim, real32_T GTx, real32_T GTy, real32_T GTPathTraveled,
  real32_T GTVehicleSpeedMs, real32_T GTYawRateRadS, real32_T GTHalfWidthM)
{
  real_T GTpolygonVertices[44];
  real_T GTcrossings;
  int32_T GTb_i;
  memset(&GTpolygonVertices[0], 0, 44U * sizeof(real_T));
  if (GTYawRateRadS > GTPoly_YawRateRadSLim->contents) {
    real32_T GTR;
    real32_T GTRl;
    real32_T GTRr;
    GTR = GTVehicleSpeedMs / GTYawRateRadS;
    GTRl = GTR - GTHalfWidthM;
    GTRr = GTR + GTHalfWidthM;
    GTR = GTPathTraveled / GTR;
    for (GTb_i = 0; GTb_i < 11; GTb_i++) {
      real32_T GTpolygonVertices_tmp;
      real32_T GTpolygonVertices_tmp_0;
      GTpolygonVertices_tmp = GTR * (real32_T)GTb_i / 10.0F;
      GTpolygonVertices_tmp_0 = (90.0F - GTR) * (real32_T)GTb_i / 10.0F;
      GTpolygonVertices[GTb_i] = cosf(GTpolygonVertices_tmp) * GTRl - cosf
        (GTpolygonVertices_tmp_0) * GTPathTraveled;
      GTpolygonVertices[GTb_i + 22] = sinf(GTpolygonVertices_tmp) * GTRl - sinf
        (GTpolygonVertices_tmp_0) * GTPathTraveled;
      GTpolygonVertices_tmp = (10.0F - (real32_T)GTb_i) * GTR / 10.0F;
      GTpolygonVertices_tmp_0 = (90.0F - GTR) * (10.0F - (real32_T)GTb_i) /
        10.0F;
      GTpolygonVertices[GTb_i + 11] = cosf(GTpolygonVertices_tmp) * GTRr - cosf
        (GTpolygonVertices_tmp_0) * GTPathTraveled;
      GTpolygonVertices[GTb_i + 33] = sinf(GTpolygonVertices_tmp) * GTRr - sinf
        (GTpolygonVertices_tmp_0) * GTPathTraveled;
    }
  } else {
    for (GTb_i = 0; GTb_i < 11; GTb_i++) {
      GTpolygonVertices[GTb_i] = GTPathTraveled * (real32_T)GTb_i / 10.0F;
      GTpolygonVertices[GTb_i + 22] = GTHalfWidthM;
      GTpolygonVertices[GTb_i + 11] = (10.0F - (real32_T)GTb_i) * GTPathTraveled
        / 10.0F;
      GTpolygonVertices[GTb_i + 33] = -GTHalfWidthM;
    }
  }

  GTcrossings = 0.0;
  for (GTb_i = 0; GTb_i < 22; GTb_i++) {
    real_T GTx2;
    real_T GTy2;
    if (GTb_i + 1 == 22) {
      GTx2 = GTpolygonVertices[0];
      GTy2 = GTpolygonVertices[22];
    } else {
      GTx2 = GTpolygonVertices[GTb_i + 1];
      GTy2 = GTpolygonVertices[GTb_i + 23];
    }

    if (((GTpolygonVertices[GTb_i] <= GTx) && (GTx2 > GTx)) ||
        ((GTpolygonVertices[GTb_i] > GTx) && (GTx2 <= GTx))) {
      real_T GTtmp;
      GTtmp = GTpolygonVertices[GTb_i + 22];
      if ((real32_T)(GTy2 - GTtmp) * (GTy - (real32_T)GTpolygonVertices[GTb_i]) /
          (real32_T)(GTx2 - GTpolygonVertices[GTb_i]) + (real32_T)GTtmp > GTy) {
        GTcrossings++;
      }
    }
  }

  if (GTcrossings == 0.0) {
    GTb_i = 0;
  } else {
    GTb_i = (int32_T)fmod(GTcrossings, 2.0);
  }

  return GTb_i == 1;
}

static void ADAS_MATLABFunction1(real32_T GTu_FObj1Sx1, real32_T GTu_FObj1Sx2,
  real32_T GTu_FObj1Sy1, real32_T GTu_FObj1Sy2, real32_T GTu_VehicleSpeedMs,
  real32_T GTu_YawRateRadS, real32_T GTu_HalfWidthM, real32_T
  GTu_PathTraveledFcw, real32_T GTu_PathTraveledAeb, real32_T
  GTu_Poly_YawRateRadSLim, uint8_T *GTy_isInsideFcw, uint8_T *GTy_isInsideAeb)
{
  captured_var_ADAS_T GTPoly_YawRateRadSLim;
  real32_T GTx;
  real32_T GTx_tmp;
  real32_T GTy;
  real32_T GTy_tmp;
  GTPoly_YawRateRadSLim.contents = GTu_Poly_YawRateRadSLim;
  *GTy_isInsideFcw = 0U;
  *GTy_isInsideAeb = 0U;
  if (ADAS_isPointInPolygon(&GTPoly_YawRateRadSLim, GTu_FObj1Sx1, GTu_FObj1Sy1,
       GTu_PathTraveledFcw, GTu_VehicleSpeedMs, GTu_YawRateRadS, GTu_HalfWidthM))
  {
    *GTy_isInsideFcw = 1U;
    if (ADAS_isPointInPolygon(&GTPoly_YawRateRadSLim, GTu_FObj1Sx1, GTu_FObj1Sy1,
         GTu_PathTraveledAeb, GTu_VehicleSpeedMs, GTu_YawRateRadS,
         GTu_HalfWidthM)) {
      *GTy_isInsideAeb = 1U;
    }
  }

  GTx_tmp = GTu_FObj1Sx2 - GTu_FObj1Sx1;
  GTx = GTx_tmp * 0.5F + GTu_FObj1Sx1;
  GTy_tmp = GTu_FObj1Sy2 - GTu_FObj1Sy1;
  GTy = GTy_tmp * 0.5F + GTu_FObj1Sy1;
  if (ADAS_isPointInPolygon(&GTPoly_YawRateRadSLim, GTx, GTy,
       GTu_PathTraveledFcw, GTu_VehicleSpeedMs, GTu_YawRateRadS, GTu_HalfWidthM))
  {
    *GTy_isInsideFcw = 1U;
    if (ADAS_isPointInPolygon(&GTPoly_YawRateRadSLim, GTx, GTy,
         GTu_PathTraveledAeb, GTu_VehicleSpeedMs, GTu_YawRateRadS,
         GTu_HalfWidthM)) {
      *GTy_isInsideAeb = 1U;
    }
  }

  GTx = GTx_tmp + GTu_FObj1Sx1;
  GTy = GTy_tmp + GTu_FObj1Sy1;
  if (ADAS_isPointInPolygon(&GTPoly_YawRateRadSLim, GTx, GTy,
       GTu_PathTraveledFcw, GTu_VehicleSpeedMs, GTu_YawRateRadS, GTu_HalfWidthM))
  {
    *GTy_isInsideFcw = 1U;
    if (ADAS_isPointInPolygon(&GTPoly_YawRateRadSLim, GTx, GTy,
         GTu_PathTraveledAeb, GTu_VehicleSpeedMs, GTu_YawRateRadS,
         GTu_HalfWidthM)) {
      *GTy_isInsideAeb = 1U;
    }
  }
}

