static void ADAS_LCC_warning_requester_SF(boolean_T GTu_CVW, boolean_T GTu_BSW,
  boolean_T GTu_TurnSignalSts, real32_T GTu_MinWarnTime, real32_T
  GTu_DelayTimeOnFallEdge, real32_T GTu_LccBlockWarnTime, real32_T
  GTu_DelayTimeOnRisingEdge, uint8_T *GTy_DtLogLccWarnReqTrans, uint8_T
  *GTy_LccLedReq, uint8_T *GTy_LccWarnReq, DW_LCC_warning_requester_SF_A_T
  *localDW)
{
  if (localDW->GTtemporalCounter_i1 < MAX_uint32_T) {
    localDW->GTtemporalCounter_i1++;
  }

  if (localDW->GTis_active_c224_ADAS == 0U) {
    localDW->GTis_active_c224_ADAS = 1U;
    localDW->GTdurationCounter_2 = 0;
    localDW->GTdurationCounter_1 = 0;
    localDW->GTis_c224_ADAS = ADAS_IN_Expectation_d;
    localDW->GTtemporalCounter_i1 = 0U;
    *GTy_LccLedReq = 0U;
    *GTy_LccWarnReq = 0U;
  } else if (localDW->GTis_c224_ADAS == ADAS_IN_Expectation_d) {
    boolean_T guard1 = false;
    guard1 = false;
    if (GTu_CVW && (((real_T)localDW->GTdurationCounter_2 >=
                     GTu_DelayTimeOnRisingEdge * 20.0F) &&
                    (localDW->GTtemporalCounter_i1 >= GTu_LccBlockWarnTime *
                     20.0F))) {
      *GTy_DtLogLccWarnReqTrans = 2U;
      guard1 = true;
    } else if (GTu_BSW && (((real_T)localDW->GTdurationCounter_1 >=
                            GTu_DelayTimeOnRisingEdge * 20.0F) &&
                           (localDW->GTtemporalCounter_i1 >=
                            GTu_LccBlockWarnTime * 20.0F))) {
      *GTy_DtLogLccWarnReqTrans = 1U;
      guard1 = true;
    } else {
      *GTy_LccLedReq = 0U;
      *GTy_LccWarnReq = 0U;
    }

    if (guard1) {
      localDW->GTdurationCounter_1_e = 0;
      localDW->GTis_c224_ADAS = ADAS_IN_Warning;
      localDW->GTtemporalCounter_i1 = 0U;
      localDW->GTis_Warning = ADAS_IN_Warning_level1_e;
      *GTy_LccLedReq = 1U;
      *GTy_LccWarnReq = 0U;
    }
  } else if ((!GTu_BSW) && (!GTu_CVW) && (localDW->GTtemporalCounter_i1 >=
              GTu_MinWarnTime * 20.0F) && ((real_T)
              localDW->GTdurationCounter_1_e >= GTu_DelayTimeOnFallEdge * 20.0F))
  {
    *GTy_DtLogLccWarnReqTrans = 3U;
    localDW->GTis_Warning = ADAS_IN_NO_ACTIVE_CHILD_a;
    localDW->GTdurationCounter_2 = 0;
    localDW->GTdurationCounter_1 = 0;
    localDW->GTis_c224_ADAS = ADAS_IN_Expectation_d;
    localDW->GTtemporalCounter_i1 = 0U;
    *GTy_LccLedReq = 0U;
    *GTy_LccWarnReq = 0U;
  } else if (localDW->GTis_Warning == ADAS_IN_Warning_level1_e) {
    if (GTu_TurnSignalSts) {
      *GTy_DtLogLccWarnReqTrans = 4U;
      localDW->GTis_Warning = ADAS_IN_Warning_level2_p;
      *GTy_LccLedReq = 2U;
      *GTy_LccWarnReq = 1U;
    } else {
      *GTy_LccLedReq = 1U;
      *GTy_LccWarnReq = 0U;
    }
  } else if (!GTu_TurnSignalSts) {
    *GTy_DtLogLccWarnReqTrans = 5U;
    localDW->GTis_Warning = ADAS_IN_Warning_level1_e;
    *GTy_LccLedReq = 1U;
    *GTy_LccWarnReq = 0U;
  } else {
    *GTy_LccLedReq = 2U;
    *GTy_LccWarnReq = 1U;
  }

  if (GTu_BSW) {
    localDW->GTdurationCounter_1++;
  } else {
    localDW->GTdurationCounter_1 = 0;
  }

  if (GTu_CVW) {
    localDW->GTdurationCounter_2++;
  } else {
    localDW->GTdurationCounter_2 = 0;
  }

  if ((!GTu_BSW) && (!GTu_CVW)) {
    localDW->GTdurationCounter_1_e++;
  } else {
    localDW->GTdurationCounter_1_e = 0;
  }
}

static void ADAS_DS_MA_Filter2(real32_T GTu_u, real32_T GTu_windowSize, real32_T
  GTu_reset, const real32_T GTu_bufferIn[100], real32_T GTu_sumIn, real32_T
  GTu_idxIn, real32_T *GTy_y, real32_T GTy_bufferOut[100], real32_T *GTy_sumOut,
  real32_T *GTy_idxOut)
{
  int32_T GTi;
  real32_T GTsumOut;
  real32_T GTwindowSize;
  GTwindowSize = fminf(floorf(GTu_windowSize), 100.0F);
  if ((GTu_reset != 0.0F) || (GTwindowSize < 1.0F)) {
    for (GTi = 0; GTi < 100; GTi++) {
      if ((real_T)GTi + 1.0 <= GTwindowSize) {
        GTy_bufferOut[GTi] = GTu_u;
      } else {
        GTy_bufferOut[GTi] = 0.0F;
      }
    }

    GTsumOut = GTu_u * GTwindowSize;
    *GTy_idxOut = 1.0F;
  } else {
    real32_T GTtmp;
    memcpy(&GTy_bufferOut[0], &GTu_bufferIn[0], 100U * sizeof(real32_T));
    GTtmp = floorf(GTu_idxIn);
    GTy_bufferOut[(int32_T)GTtmp - 1] = GTu_u;
    GTsumOut = (GTu_sumIn - GTu_bufferIn[(int32_T)floorf(GTu_idxIn) - 1]) +
      GTu_u;
    *GTy_idxOut = GTtmp + 1.0F;
    if (GTtmp + 1.0F > GTwindowSize) {
      *GTy_idxOut = 1.0F;
    }
  }

  if (GTwindowSize > 0.0F) {
    *GTy_y = GTsumOut / GTwindowSize;
  } else {
    *GTy_y = GTu_u;
  }

  *GTy_sumOut = GTsumOut;
}

