static void ADAS_CORRECTION(uint8_T GTu_Enable, real32_T GTu_LaneFrontSx10,
  real32_T GTu_LaneFrontSx15, real32_T GTu_LaneFrontSx20, real32_T
  *GTy_Correction, real32_T *GTy_Radius, DW_CORRECTION_ADAS_T *localDW)
{
  if (GTu_Enable > 0) {
    int32_T GTsuperStepCount;
    real32_T GTE;
    real32_T GTF;
    if (!localDW->GTCORRECTION_MODE) {
      ADAS_CORRECTION_Reset(localDW);
      localDW->GTCORRECTION_MODE = true;
    }

    if ((GTu_LaneFrontSx10 == 202.0F) || (GTu_LaneFrontSx15 == 202.0F) ||
        (GTu_LaneFrontSx20 == 202.0F)) {
      *GTy_Radius = 4444.0F;
    } else {
      real32_T GTB;
      real32_T GTD;
      real32_T GTG;
      GTB = GTu_LaneFrontSx15 - GTu_LaneFrontSx10;
      GTD = GTu_LaneFrontSx20 - GTu_LaneFrontSx10;
      GTE = (GTu_LaneFrontSx10 + GTu_LaneFrontSx15) * GTB + 125.0F;
      GTF = (GTu_LaneFrontSx10 + GTu_LaneFrontSx20) * GTD + 300.0F;
      GTG = ((GTu_LaneFrontSx20 - GTu_LaneFrontSx15) * 5.0F - GTB * 5.0F) * 2.0F;
      if (GTG < 0.1) {
        *GTy_Radius = 1000.0F;
      } else {
        GTB = (GTD * GTE - GTB * GTF) / GTG - 15.0F;
        GTE = (5.0F * GTF - 10.0F * GTE) / GTG - GTu_LaneFrontSx15;
        *GTy_Radius = GTB * GTB + GTE * GTE;
        *GTy_Radius = sqrtf(*GTy_Radius);
        if (*GTy_Radius > 1000.0F) {
          *GTy_Radius = 1000.0F;
        }
      }
    }

    if (localDW->GTtemporalCounter_i1 < MAX_uint32_T) {
      localDW->GTtemporalCounter_i1++;
    }

    GTsuperStepCount = 0;
    boolean_T GTisStable;
    do {
      GTisStable = true;
      if (localDW->GTis_active_c271_ADAS == 0U) {
        localDW->GTis_active_c271_ADAS = 1U;
        localDW->GTis_c271_ADAS = ADAS_IN_NO_CORRECTION;
        GTisStable = false;
        localDW->GTis_NO_CORRECTION = ADAS_IN_NORMAL;
        localDW->GTCorrection = 0.0F;
      } else if (localDW->GTis_c271_ADAS == ADAS_IN_CORRECTION) {
        if ((*GTy_Radius > TurningRadius + 20.0F) || (*GTy_Radius == 4444.0F)) {
          localDW->GTis_c271_ADAS = ADAS_IN_NO_CORRECTION;
          GTisStable = false;
          localDW->GTis_NO_CORRECTION = ADAS_IN_DELAY;
          localDW->GTtemporalCounter_i1 = 0U;
        } else {
          localDW->GTCorrection = TurnExtWarnLine;
        }
      } else if (*GTy_Radius < TurningRadius) {
        localDW->GTis_NO_CORRECTION = ADAS_IN_NO_ACTIVE_CHILD_d;
        GTisStable = false;
        localDW->GTis_c271_ADAS = ADAS_IN_CORRECTION;
        localDW->GTCorrection = TurnExtWarnLine;
      } else if (localDW->GTis_NO_CORRECTION == ADAS_IN_DELAY) {
        if (localDW->GTtemporalCounter_i1 >= DelayCorrTime * 20.0F) {
          GTisStable = false;
          localDW->GTis_NO_CORRECTION = ADAS_IN_NORMAL;
          localDW->GTCorrection = 0.0F;
        }
      } else {
        localDW->GTCorrection = 0.0F;
      }

      GTsuperStepCount++;
    } while ((!GTisStable) && ((uint32_T)GTsuperStepCount <= 20U));

    if (localDW->GTCorrection > 0.3F) {
      GTE = 0.3F;
    } else if (localDW->GTCorrection < 0.0F) {
      GTE = 0.0F;
    } else {
      GTE = localDW->GTCorrection;
    }

    GTF = GTE - localDW->GTPrevY;
    if (GTF > 0.5F) {
      *GTy_Correction = localDW->GTPrevY + 0.5F;
    } else if (GTF < -0.01F) {
      *GTy_Correction = localDW->GTPrevY + -0.01F;
    } else {
      *GTy_Correction = GTE;
    }

    localDW->GTPrevY = *GTy_Correction;
  } else if (localDW->GTCORRECTION_MODE) {
    ADAS_CORRECTION_Disable(GTy_Correction, GTy_Radius, localDW);
  }
}

