  localDW->GTDelayInput1_DSTATE_e = GTu_NumZone;
  localDW->GTDelayInput2_DSTATE = rtb_GT_UkYk1_ko;
  localDW->GTDelayInput2_DSTATE_f = rtb_GT_Abs1_c;
