static void enter_internal_ACC_DIST_CHANGE_(void)
{
  if ((rtDW_ADAS.GTS_coef < rtDW_ADAS.GTSmax_coef) && (rtDW_ADAS.GTUP == 1.0)) {
    int32_T GTtmp;
    rtDW_ADAS.GTis_ACC_DIST_CHANGE_BUTTON_1 = ADAS_IN_DIST1;
    rtDW_ADAS.GTtemporalCounter_i3 = 0U;
    GTtmp = (int32_T)((uint32_T)rtDW_ADAS.GTS_coef + rtDW_ADAS.GTSteep_dist);
    if ((uint32_T)GTtmp > 255U) {
      GTtmp = 255;
    }

    rtDW_ADAS.GTS_coef = (uint8_T)GTtmp;
  } else if ((rtDW_ADAS.GTS_coef > 0) && (rtDW_ADAS.GTUP == 0.0)) {
    uint32_T GTqY;
    rtDW_ADAS.GTis_ACC_DIST_CHANGE_BUTTON_1 = ADAS_IN_DIST2;
    rtDW_ADAS.GTtemporalCounter_i3 = 0U;
    GTqY = (uint32_T)rtDW_ADAS.GTS_coef - rtDW_ADAS.GTSteep_dist;
    if (GTqY > rtDW_ADAS.GTS_coef) {
      GTqY = 0U;
    }

    rtDW_ADAS.GTS_coef = (uint8_T)GTqY;
  } else if (rtDW_ADAS.GTS_coef <= 0) {
    rtDW_ADAS.GTis_ACC_DIST_CHANGE_BUTTON_1 = ADAS_IN_Down_state;
    rtDW_ADAS.GTtemporalCounter_i3 = 0U;
    rtDW_ADAS.GTUP = 1.0;
    rtDW_ADAS.GTS_coef = rtDW_ADAS.GTSteep_dist;
  } else if (rtDW_ADAS.GTS_coef >= rtDW_ADAS.GTSmax_coef) {
    uint32_T GTqY;
    rtDW_ADAS.GTis_ACC_DIST_CHANGE_BUTTON_1 = ADAS_IN_Up_state;
    rtDW_ADAS.GTtemporalCounter_i3 = 0U;
    rtDW_ADAS.GTUP = 0.0;
    GTqY = (uint32_T)rtDW_ADAS.GTS_coef - rtDW_ADAS.GTSteep_dist;
    if (GTqY > rtDW_ADAS.GTS_coef) {
      GTqY = 0U;
    }

    rtDW_ADAS.GTS_coef = (uint8_T)GTqY;
  } else {
    rtDW_ADAS.GTis_ACC_DIST_CHANGE_BUTTON_1 = ADAS_IN_Wait1;
  }
}

