real_T rt_roundd(real_T GTu)
{
  real_T GTy;
  if (fabs(GTu) < 4.503599627370496E+15) {
    if (GTu >= 0.5) {
      GTy = floor(GTu + 0.5);
    } else if (GTu > -0.5) {
      GTy = 0.0;
    } else {
      GTy = ceil(GTu - 0.5);
    }
  } else {
    GTy = GTu;
  }

  return GTy;
}

