static boolean_T ADAS_isPointInPolygon_j(const captured_var_ADAS_T
  *GTPoly_YawRateRadSLim, real32_T GTx, real32_T GTy, real32_T GTPathTraveled,
  real32_T GTVehicleSpeedMs, real_T GTYawRateRadS, real32_T GTHalfWidthM)
{
  real_T GTpolygonVertices[44];
  real_T GTcrossings;
  int32_T GTb_i;
  memset(&GTpolygonVertices[0], 0, 44U * sizeof(real_T));
  if (GTYawRateRadS > GTPoly_YawRateRadSLim->contents) {
    real32_T GTR;
    real32_T GTRl;
    real32_T GTRr;
    real32_T GTpolygonVertices_tmp;
    GTR = GTVehicleSpeedMs / (real32_T)GTYawRateRadS;
    GTRl = GTR - GTHalfWidthM;
    GTRr = GTR + GTHalfWidthM;
    GTR = GTPathTraveled / GTR;
    GTpolygonVertices_tmp = cosf(GTR);
    for (GTb_i = 0; GTb_i < 11; GTb_i++) {
      GTpolygonVertices[GTb_i] = sinf(GTR * (real32_T)GTb_i / 10.0F) * GTRl;
      GTpolygonVertices[GTb_i + 22] = GTRl * GTpolygonVertices_tmp + -GTRl;
      GTpolygonVertices[GTb_i + 11] = sinf((10.0F - (real32_T)GTb_i) * GTR /
        10.0F) * GTRr;
      GTpolygonVertices[GTb_i + 33] = GTRr * GTpolygonVertices_tmp + -GTRr;
    }
  } else {
    for (GTb_i = 0; GTb_i < 11; GTb_i++) {
      GTpolygonVertices[GTb_i] = GTPathTraveled * (real32_T)GTb_i / 10.0F;
      GTpolygonVertices[GTb_i + 22] = GTHalfWidthM;
      GTpolygonVertices[GTb_i + 11] = (10.0F - (real32_T)GTb_i) * GTPathTraveled
        / 10.0F;
      GTpolygonVertices[GTb_i + 33] = -GTHalfWidthM;
    }
  }

  GTcrossings = 0.0;
  for (GTb_i = 0; GTb_i < 22; GTb_i++) {
    real_T GTx2;
    real_T GTy2;
    if (GTb_i + 1 == 22) {
      GTx2 = GTpolygonVertices[0];
      GTy2 = GTpolygonVertices[22];
    } else {
      GTx2 = GTpolygonVertices[GTb_i + 1];
      GTy2 = GTpolygonVertices[GTb_i + 23];
    }

    if (((GTpolygonVertices[GTb_i] <= GTx) && (GTx2 > GTx)) ||
        ((GTpolygonVertices[GTb_i] > GTx) && (GTx2 <= GTx))) {
      real_T GTtmp;
      GTtmp = GTpolygonVertices[GTb_i + 22];
      if ((real32_T)(GTy2 - GTtmp) * (GTy - (real32_T)GTpolygonVertices[GTb_i]) /
          (real32_T)(GTx2 - GTpolygonVertices[GTb_i]) + (real32_T)GTtmp > GTy) {
        GTcrossings++;
      }
    }
  }

  if (GTcrossings == 0.0) {
    GTb_i = 0;
  } else {
    GTb_i = (int32_T)fmod(GTcrossings, 2.0);
  }

  return GTb_i == 1;
}

static boolean_T ADAS_sortLE(const real32_T GTv[120], int32_T GTidx1, int32_T
  GTidx2)
{
  int32_T GTk;
  boolean_T GTp;
  boolean_T exitg1;
  GTp = true;
  GTk = 0;
  exitg1 = false;
  while ((!exitg1) && (GTk < 2)) {
    int32_T GTabscolk;
    real32_T GTtmp;
    real32_T GTtmp_0;
    GTabscolk = (GTk << 1) + 1;
    GTtmp = GTv[(20 * GTabscolk + GTidx1) - 1];
    GTtmp_0 = GTv[(20 * GTabscolk + GTidx2) - 1];
    if (GTtmp == GTtmp_0) {
      GTk++;
    } else {
      GTp = (GTtmp <= GTtmp_0);
      exitg1 = true;
    }
  }

  return GTp;
}

static void ADAS_sortrows(real32_T GTy[120])
{
  int32_T GTidx[20];
  int32_T GTiwork[20];
  int32_T GTc_i;
  int32_T GTi2;
  int32_T GTpEnd;
  real32_T GTycol[20];
  GTc_i = 2;
  for (GTi2 = 0; GTi2 <= 19; GTi2 += 2) {
    if (ADAS_sortLE(GTy, GTi2 + 1, GTi2 + 2)) {
      GTidx[GTi2] = GTi2 + 1;
      GTidx[GTi2 + 1] = GTi2 + 2;
    } else {
      GTidx[GTi2] = GTi2 + 2;
      GTidx[GTi2 + 1] = GTi2 + 1;
    }
  }

  while (GTc_i < 20) {
    int32_T GTb_j;
    GTi2 = GTc_i << 1;
    GTb_j = 1;
    GTpEnd = GTc_i + 1;
    while (GTpEnd < 21) {
      int32_T GTk;
      int32_T GTkEnd;
      int32_T GTp;
      int32_T GTq;
      int32_T GTqEnd;
      GTp = GTb_j;
      GTq = GTpEnd;
      GTqEnd = GTb_j + GTi2;
      if (GTqEnd > 21) {
        GTqEnd = 21;
      }

      GTk = 0;
      GTkEnd = GTqEnd - GTb_j;
      while (GTk + 1 <= GTkEnd) {
        int32_T GTtmp;
        int32_T GTtmp_0;
        GTtmp_0 = GTidx[GTq - 1];
        GTtmp = GTidx[GTp - 1];
        if (ADAS_sortLE(GTy, GTtmp, GTtmp_0)) {
          GTiwork[GTk] = GTtmp;
          GTp++;
          if (GTp == GTpEnd) {
            while (GTq < GTqEnd) {
              GTk++;
              GTiwork[GTk] = GTidx[GTq - 1];
              GTq++;
            }
          }
        } else {
          GTiwork[GTk] = GTtmp_0;
          GTq++;
          if (GTq == GTqEnd) {
            while (GTp < GTpEnd) {
              GTk++;
              GTiwork[GTk] = GTidx[GTp - 1];
              GTp++;
            }
          }
        }

        GTk++;
      }

      for (GTpEnd = -1; GTpEnd < GTkEnd - 1; GTpEnd++) {
        GTidx[GTb_j + GTpEnd] = GTiwork[GTpEnd + 1];
      }

      GTb_j = GTqEnd;
      GTpEnd = GTqEnd + GTc_i;
    }

    GTc_i = GTi2;
  }

  for (GTc_i = 0; GTc_i < 6; GTc_i++) {
    for (GTi2 = 0; GTi2 < 20; GTi2++) {
      GTycol[GTi2] = GTy[(20 * GTc_i + GTidx[GTi2]) - 1];
    }

    memcpy(&GTy[GTc_i * 20], &GTycol[0], 20U * sizeof(real32_T));
  }
}

static void ADAS_computeRange(const real_T GTxv[12], int32_T GTnloops, const
  int32_T GTfirst[12], const int32_T GTlast[12], real_T *GTminxv, real_T
  *GTmaxxv)
{
  int32_T GTb_k;
  int32_T GTj;
  *GTminxv = GTxv[GTfirst[0] - 1];
  *GTmaxxv = *GTminxv;
  for (GTb_k = 0; GTb_k < GTnloops; GTb_k++) {
    for (GTj = GTfirst[GTb_k] - 1; GTj < GTlast[GTb_k]; GTj++) {
      if (GTxv[GTj] < *GTminxv) {
        *GTminxv = GTxv[GTj];
      } else if (GTxv[GTj] > *GTmaxxv) {
        *GTmaxxv = GTxv[GTj];
      }
    }
  }
}

static void ADAS_contrib(real_T GTx1, real_T GTb_y1, real_T GTx2, real_T GTy2,
  int8_T GTquad1, int8_T GTquad2, real_T GTscale, int8_T *GTdiffQuad, boolean_T *
  GTonj)
{
  real_T GTcp;
  *GTonj = false;
  *GTdiffQuad = (int8_T)(GTquad2 - GTquad1);
  GTcp = GTx1 * GTy2 - GTx2 * GTb_y1;
  if (fabs(GTcp) < GTscale) {
    *GTonj = (GTx1 * GTx2 + GTb_y1 * GTy2 <= 0.0);
    if ((*GTdiffQuad == 2) || (*GTdiffQuad == -2)) {
      *GTdiffQuad = 0;
    } else if (*GTdiffQuad == -3) {
      *GTdiffQuad = 1;
    } else if (*GTdiffQuad == 3) {
      *GTdiffQuad = -1;
    }
  } else if (GTcp < 0.0) {
    if (*GTdiffQuad == 2) {
      *GTdiffQuad = -2;
    } else if (*GTdiffQuad == -3) {
      *GTdiffQuad = 1;
    } else if (*GTdiffQuad == 3) {
      *GTdiffQuad = -1;
    }
  } else if (*GTdiffQuad == -2) {
    *GTdiffQuad = 2;
  } else if (*GTdiffQuad == -3) {
    *GTdiffQuad = 1;
  } else if (*GTdiffQuad == 3) {
    *GTdiffQuad = -1;
  }
}

static void ADAS_inpolygon(real32_T GTx, real32_T GTy, const real_T GTxv[12],
  const real_T GTyv[12], boolean_T *GTin, boolean_T *GTon)
{
  real_T GTscale[12];
  real_T GTxv1;
  real_T GTxv2;
  real_T GTxvFirst;
  real_T GTyv1;
  real_T GTyv2;
  real_T GTyvFirst;
  int32_T GTfirst[12];
  int32_T GTlast[12];
  int32_T GTi;
  int8_T GTb_dquad;
  int8_T GTquad1;
  *GTin = false;
  *GTon = false;
  for (GTi = 0; GTi < 12; GTi++) {
    GTfirst[GTi] = 0;
    GTlast[GTi] = 0;
  }

  GTfirst[0] = 1;
  if ((GTxv[0] == GTxv[11]) && (GTyv[0] == GTyv[11])) {
    GTlast[0] = 11;
  } else {
    GTlast[0] = 12;
  }

  ADAS_computeRange(GTxv, 1, GTfirst, GTlast, &GTxvFirst, &GTyvFirst);
  ADAS_computeRange(GTyv, 1, GTfirst, GTlast, &GTxv2, &GTyv2);
  memset(&GTscale[0], 0, 12U * sizeof(real_T));
  for (GTi = 1; GTi < GTlast[0]; GTi++) {
    GTxv1 = fabs((GTxv[GTi - 1] + GTxv[GTi]) * 0.5);
    GTyv1 = fabs((GTyv[GTi - 1] + GTyv[GTi]) * 0.5);
    if ((GTxv1 > 1.0) && (GTyv1 > 1.0)) {
      GTxv1 *= GTyv1;
    } else {
      GTxv1 = fmax(GTyv1, GTxv1);
    }

    GTscale[GTi - 1] = GTxv1 * 6.6613381477509392E-16;
  }

  GTxv1 = fabs((GTxv[GTlast[0] - 1] + GTxv[0]) * 0.5);
  GTyv1 = fabs((GTyv[GTlast[0] - 1] + GTyv[0]) * 0.5);
  if ((GTxv1 > 1.0) && (GTyv1 > 1.0)) {
    GTxv1 *= GTyv1;
  } else {
    GTxv1 = fmax(GTyv1, GTxv1);
  }

  GTscale[GTlast[0] - 1] = GTxv1 * 6.6613381477509392E-16;
  if ((GTx >= GTxvFirst) && (GTx <= GTyvFirst) && (GTy >= GTxv2) && (GTy <=
       GTyv2)) {
    int8_T GTquad2;
    int8_T GTquadFirst;
    int8_T GTsdq;
    GTsdq = 0;
    GTxvFirst = GTxv[0] - GTx;
    GTyvFirst = GTyv[0] - GTy;
    if (GTxvFirst > 0.0) {
      if (GTyvFirst > 0.0) {
        GTquadFirst = 0;
      } else {
        GTquadFirst = 3;
      }
    } else if (GTyvFirst > 0.0) {
      GTquadFirst = 1;
    } else {
      GTquadFirst = 2;
    }

    GTxv2 = GTxvFirst;
    GTyv2 = GTyvFirst;
    GTquad2 = GTquadFirst;
    GTi = 1;
    int32_T exitg1;
    do {
      exitg1 = 0;
      if (GTi <= GTlast[0] - 1) {
        GTxv1 = GTxv2;
        GTyv1 = GTyv2;
        GTxv2 = GTxv[GTi] - GTx;
        GTyv2 = GTyv[GTi] - GTy;
        GTquad1 = GTquad2;
        if (GTxv2 > 0.0) {
          if (GTyv2 > 0.0) {
            GTquad2 = 0;
          } else {
            GTquad2 = 3;
          }
        } else if (GTyv2 > 0.0) {
          GTquad2 = 1;
        } else {
          GTquad2 = 2;
        }

        ADAS_contrib(GTxv1, GTyv1, GTxv2, GTyv2, GTquad1, GTquad2, GTscale[GTi -
                     1], &GTb_dquad, GTon);
        if (*GTon) {
          *GTin = true;
          exitg1 = 1;
        } else {
          GTsdq += GTb_dquad;
          GTi++;
        }
      } else {
        ADAS_contrib(GTxv2, GTyv2, GTxvFirst, GTyvFirst, GTquad2, GTquadFirst,
                     GTscale[GTlast[0] - 1], &GTquad1, GTon);
        if (*GTon) {
          *GTin = true;
        } else {
          *GTin = ((int8_T)(GTsdq + GTquad1) != 0);
        }

        exitg1 = 1;
      }
    } while (exitg1 == 0);
  }
}

